  CREATE OR REPLACE NONEDITIONABLE TRIGGER "SYSTEM"."TRG_REVIEWS_AUTOINC" 
BEFORE INSERT ON reviews
FOR EACH ROW
 WHEN (NEW.review_id IS NULL) BEGIN
  SELECT review_seq.NEXTVAL
  INTO :NEW.review_id
  FROM dual;
END;

/
ALTER TRIGGER "SYSTEM"."TRG_REVIEWS_AUTOINC" ENABLE;
